import React, { useEffect } from "react";
import { useParams } from "react-router-dom";
import { CardBasic } from "../Components/CardBasic";
import { apaksa } from "../Components/apaksa";
import background from "../Restes_bildes/balts.png";

export const Floor = () => {
  const param = useParams();
  const { id } = param;
  useEffect(() => {
    // api call
    console.log("also i call something to python");
    console.log(id);
  }, [id]);

  return <>
  <div>Floor {id}</div>
    <CardBasic>
       <img style={{ position: "relative", top: 550,left:450}} src={background} alt="Logo" />
       <img style={{ position: "relative", top: 625,left:450}} src={background} alt="Logo" />
       <img style={{ position: "relative", top: 725,left:450}} src={background} alt="Logo" />
       <img style={{ position: "relative", top: 825,left:450}} src={background} alt="Logo" />
       <img style={{ position: "relative", top: 925,left:450}} src={background} alt="Logo" />


    </CardBasic>

</>
};
